import Sidebar from "../../components/Sidebar/Sidebar";
import Map from "../../components/Map/Map"

function Home() {
  return (
    <div>
      <div className="container">
        <Sidebar />
        <div className="area">
          <Map />
        </div>
      </div>
    </div>
  );
}

export default Home;
